import { useNavigate } from 'react-router-dom';

import './Details.css';
import { Wrapper, DetailsContainer } from './style.js';

const TodoDetails = ({ id, inputTitle, input, isDone }) => {
  const navigate = useNavigate();

  // 이전 페이지 이동 핸들러
  const previousPageHanlder = () => {
    navigate(-1, true);
  };

  return (
    <Wrapper>
      <DetailsContainer>
        <div className='details_top'>
          <div>ID : {id}</div>
          <button onClick={previousPageHanlder} className='return_button'>
            이전으로
          </button>
        </div>
        <div className='details_bottom'>
          <h2>{inputTitle}</h2>
          <div className='line'></div>
          <p className='todo-context'>{input}</p>
        </div>
      </DetailsContainer>
    </Wrapper>
  );
};

export default TodoDetails;

